// Edit for global styles

import Header from './Header'

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'

}

export default function Layout(props) {
  return (
    <div>
      <div style={layoutStyle}>
        <Header />
        {props.children}
      </div>
      <style jsx global>{`
        h1,body {
          font-family: Helvetica ;
        }
        li {
        list-style: none;
        margin: 5px 0;
        }

        a {
          text-decoration: none;
          color: blue;
          font-family: 'Arial';
        }

        a:hover {
          opacity: 0.6;
        }

      `}</style>
    </div>
  )
}
